Padres, tutores, y otras personas quienes cuidan de nuestros estudiantes;
La computadoras o chromebooks se necesitan regresar a la escuela este Jueves 21 de mayo y viernes 22 de mayo. Si tiene alguna pregunta llame al 801-305-1450 La escuela se abrirá de 9AM a 3:00PM los dos dias.

Parents, guardians, and other persons caring for our students;
The chromebooks will be due pack in the building Thursday, May 21st or at the latest by Friday, May 22nd.If you have any questions, please call 801-305-1450 THE SCHOOL WILL BE OPEN FROM 9AM-3:00PM both days.

