post_text:
Padres y Tutores de Estudiantes de Kinder & 6o Grados- Parents & Guardians of Kindergarten & 6th grade students;

Vamos a poner las fotos de promoción/graduación del 29 de mayo en Facebook mañana por la mañana, si prefiere que no póngamos la foto de su estudiante, avisénos antes de las 5 de la tarde el día de hoy. Usted podrá salvar la foto de Facebook.

We will be posting promotion/graduation pictures of May 29th tomorrow morning on Facebook. If you prefer that we do not post your student's picture, let us know by 5pm today. you will be able to save the photo from Facebook.

